/* eslint-disable jsx-a11y/anchor-is-valid */
import React from 'react';
import './Menu.module.css'
import './assets/dashboard.css'
import './css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

const Menu = () => {

    const links = [
        { url: '/', title: 'Главная' },
        { url: '/profil', title: 'Свод по профилям' },
        { url: '/disciplina', title: 'Свод по дисциплинам' }
    ]

    return (
        <header class="navbar navbar-dark sticky-top bg-dark flex-md-nowrap p-0 shadow">
        <Navbar bg="light" expand="lg">
      <Container>
        <Navbar.Brand class="navbar-brand col-md-3 col-lg-2 me-0 px-3" href="#home">СамГТУ</Navbar.Brand>
        <Navbar.Toggle class="navbar-toggler position-absolute d-md-none collapsed" type="button" data-bs-toggle="collapse" data-bs-target="#sidebarMenu" aria-controls="sidebarMenu" aria-expanded="false" aria-label="Навигация" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <Nav.Link href="#link">Link</Nav.Link>
            <NavDropdown title="Dropdown" id="basic-nav-dropdown">
              <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.2">
                Another action
              </NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action/3.4">
                Separated link
              </NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
    </header>
    );
}

export default Menu;
